import React, { useState } from 'react';
import './SupIncidentlist.css';

const reportedIncidentsData = [
  {
    id: 1,
    title: 'Security Breach',
    status: 'Pending',
    description: 'Unauthorized access to sensitive data.',
    assignedStaff: 'John Doe',
  },
  {
    id: 2,
    title: 'Network Outage',
    status: 'In Progress',
    description: 'Complete network outage in the main office.',
    assignedStaff: 'Jane Smith',
  },
  // Add more incidents here
];

const IncidentList = () => {
  const [selectedIncident, setSelectedIncident] = useState(null);

  const handleIncidentClick = (incident) => {
    setSelectedIncident(incident);
  };

  return (
    <div>
      <h1>Reported Incidents</h1>
      <ul>
        {reportedIncidentsData.map((incident) => (
          <li
            key={incident.id}
            onClick={() => handleIncidentClick(incident)}
            style={{
              cursor: 'pointer',
              fontWeight: selectedIncident === incident ? 'bold' : 'normal',
            }}
          >
            {incident.title}
          </li>
        ))}
      </ul>
      {selectedIncident && (
        <div>
          <h2>{selectedIncident.title}</h2>
          <p>Status: {selectedIncident.status}</p>
          <p>Description: {selectedIncident.description}</p>
          <p>Assigned Staff: {selectedIncident.assignedStaff}</p>
        </div>
      )}
    </div>
  );
};

export default IncidentList;
